import React from 'react';
import styled from 'styled-components';
import Header from '../components/Header';

const HomeContainer = styled.div`
  width: 100%;
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 20px;
`;

const HeroSection = styled.section`
  padding: 80px 0;
  text-align: center;
`;

const MainHeading = styled.h1`
  font-size: 3.5rem;
  color: #333;
  margin-bottom: 20px;
`;

const SubHeading = styled.p`
  font-size: 1.2rem;
  color: #666;
  margin-bottom: 40px;
`;

const Home = () => {
  return (
    <>
      <Header />
      <HomeContainer>
        <HeroSection>
          <MainHeading>Neutek Nursing Services</MainHeading>
          <SubHeading>Professional Healthcare Solutions for Your Needs</SubHeading>
        </HeroSection>
      </HomeContainer>
    </>
  );
};

export default Home;
